import { FormGroup, FormControl, InputLabel, Input, Typography, styled, Button } from "@mui/material";
import { useState } from "react";
import {Link} from 'react-router-dom'
const Container = styled(FormGroup)`
    width: 50%;
    margin:5% auto 0 auto ;
    & > div{
        margin-top:20px;
    }
`;

const defaultvalue = {
    name:'',
    email:'',
    password:'',
}
const SignUp = () => {
    const [user,setUser]= useState(defaultvalue);
    const onChangeValue = (e)=> {
        user[e.target.name] = e.target.value;
        setUser(user)
        //  console.log(user);
    }
    return (
        <Container>
            <Typography variant='h4' align='center'>
                Register        
            </Typography>
            <FormControl>
                <InputLabel>Enter Name</InputLabel>
                <Input onChange={(e)=>onChangeValue(e)} name='name'/>
            </FormControl>
            
            <FormControl>
                <InputLabel>Enter Email</InputLabel>
                <Input onChange={(e)=>onChangeValue(e)} name='email'/>
            </FormControl>
            <FormControl>
                <InputLabel>Enter Password</InputLabel>
                <Input onChange={(e)=>onChangeValue(e)} name='password'/>
            </FormControl>
            
            <FormControl>
                <Button variant="contained" component={Link} to={`/login`}>Sign Up</Button>
            </FormControl>
            <FormControl>
                <Button variant="contained" component={Link} to={`/login`}>Log in</Button>
            </FormControl>
        </Container>
        
    )
}

export default SignUp;
